import React, {FC, useState, useContext} from 'react';
import { Context } from '../index';
import { observer } from 'mobx-react-lite';


const Main: FC = () => {
    return (
        <div className="header">
            <nav className="header__nav">
                <div className="header__logoWrapper">
                    <img src="icons/logo.svg" alt="logo" className="header__logo"/>
                    <div className="header__themeSwitcher">
                        <div className="header__themeSwitcher__switcher"></div>
                    </div>
                </div>
                <div className="header__signInWrapper">
                    <div className="header__languageSwitcher">
                        <div className="header__language_active">UKR</div>
                        <hr/>
                        <div className="header__language">ENG</div>
                    </div>
                    <button className="header__signIn">
                        <img src="icons/sign_up_icon.svg" alt="person" className="header__signIn__icon"/>
                        <div className="header__signIn__text">Вхід</div>
                    </button>
                </div>
            </nav>
        </div>   
    );
};

export default observer(Main);
